import React from "react";
import Sdata from "../Sdta";
import Collectioncard from "./Collectioncard";

const Listpunk = () => {
  {
    Sdata.map((val) => {
      return (
        <Collectioncard
          pic={val.imgSrc}
          id={val.id}
          name={val.title}
          rate={val.price}
          imgs={val.img2}
        />
      );
    });
  }
};

export default Listpunk;
